    "contracts/SparTokenStakingContract.sol": {
      "content": "// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/security/Pausable.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/utils/Context.sol";
import "hardhat/console.sol";

interface Token {
    function transfer(address recipient, uint256 amount) external returns (bool);
    function balanceOf(address account) external view returns (uint256);
    function transferFrom(address sender, address recipient, uint256 amount) external returns (uint256);    
    function decimals() external view returns (uint8);
}

contract SparTokenStakingContract is Pausable, Ownable, ReentrancyGuard {

    Token baseToken;

    // 5 minutes (5 * 60)
    uint256 public constant stakingPeriod = 90 days;

    // 180 Days (180 * 24 * 60 * 60)
    uint256 _planExpired = 15552000;

    uint8 public annualInterestRate = 60;
    uint256 public planExpired;

    struct StakeState {
        uint256 id;
        uint256 amount;
        uint256 startTS;
        uint256 claimTS;
        uint256 endTS;
        bool isWithdrawn;
        uint256 claimedRewards;
        uint256 pendingRewards;
    }
    
    event Staked(address indexed from, uint256 amount, uint256 id);
    event Claimed(address indexed from, uint256 amount, uint256 id);
    event Withdrawn(address indexed from, uint256 amount, uint256 id);
    
    mapping(address => mapping(uint256 => StakeState)) public stakeStakeI;
    mapping(address => uint256) public stakeCounter;

    constructor(Token _tokenAddress) {
        require(address(_tokenAddress) != address(0),"Token Address cannot be address 0");                
        baseToken = _tokenAddress;        
        planExpired = block.timestamp + _planExpired;
    }

    function stakeTokens(uint256 stakeAmount) public payable whenNotPaused returns (uint256) {
        require(stakeAmount > 0, "Stake amount should be correct");
        require(block.timestamp < planExpired , "Plan Expired");
        require(baseToken.balanceOf(_msgSender()) >= stakeAmount, "Insufficient Balance");

        baseToken.transferFrom(_msgSender(), address(this), stakeAmount);
        
        uint256 userStakeIndex = stakeCounter[_msgSender()];

        stakeStakeI[_msgSender()][userStakeIndex] = StakeState({
            id: userStakeIndex,
            amount: stakeAmount,
            startTS: block.timestamp,
            claimTS: block.timestamp,
            endTS: block.timestamp + stakingPeriod,
            isWithdrawn: false,
            claimedRewards: 0,
            pendingRewards: 0
        });

        
        uint256 pendingRewardAmt = calculatePendingRewards(userStakeIndex);
        stakeStakeI[msg.sender][userStakeIndex].pendingRewards = pendingRewardAmt;

        stakeCounter[_msgSender()]++;

        emit Staked(_msgSender(), stakeAmount, userStakeIndex);

        return block.timestamp;
    }

    function unstakeTokens(uint256 userStakeIndex) public {
        require(stakeStakeI[_msgSender()][userStakeIndex].amount > 0, "Stake not found");

        StakeState memory sstate = stakeStakeI[_msgSender()][userStakeIndex];

        uint256 penaltyAmt = 0;
        if (block.timestamp < sstate.endTS) {
            uint256 pendingDuration = sstate.endTS - block.timestamp;
            uint256 maxPenalty = (sstate.amount * 80) / 100;
            uint256 calculatedPenalty = (sstate.amount * pendingDuration) / stakingPeriod;
            penaltyAmt = min(maxPenalty, calculatedPenalty);
        }

        uint256 withdrawalAmount = sstate.amount - penaltyAmt;

        require(withdrawalAmount > 0, "Withdrawal amount must be greater than 0");

        stakeStakeI[msg.sender][userStakeIndex].isWithdrawn = true;

        baseToken.transfer(_msgSender(), withdrawalAmount);

        emit Withdrawn(_msgSender(), withdrawalAmount, userStakeIndex);
    }

    function claimRewards(uint256 userStakeIndex) public {
        require(stakeStakeI[_msgSender()][userStakeIndex].amount > 0, "Stake not found");

        uint256 rewardAmt = calculateRewards(userStakeIndex);

        require(rewardAmt > 0, "No rewards available");

        stakeStakeI[msg.sender][userStakeIndex].claimTS = block.timestamp;
        stakeStakeI[msg.sender][userStakeIndex].claimedRewards = stakeStakeI[msg.sender][userStakeIndex].claimedRewards + rewardAmt;

        uint256 pendingRewardAmt = calculatePendingRewards(userStakeIndex);
        stakeStakeI[msg.sender][userStakeIndex].pendingRewards = pendingRewardAmt;

        baseToken.transfer(_msgSender(), rewardAmt);

        emit Claimed(_msgSender(), rewardAmt, userStakeIndex);
    }

    function calculateRewards (uint256 userStakeIndex) public view returns (uint256) {
        require(stakeStakeI[_msgSender()][userStakeIndex].amount > 0, "Stake not found");

        StakeState memory sstate = stakeStakeI[_msgSender()][userStakeIndex];
        
        uint256 pStaked = 0;
        if(block.timestamp < sstate.endTS) {
            pStaked = block.timestamp - sstate.claimTS;
        } else {
            pStaked = sstate.endTS - sstate.claimTS;
        }

        uint256 rewardAmt = (sstate.amount * pStaked * annualInterestRate) / (365 days * 100);

        return rewardAmt;
    }

    function calculatePendingRewards (uint256 userStakeIndex) public view returns (uint256) {
        require(stakeStakeI[_msgSender()][userStakeIndex].amount > 0, "Stake not found");

        StakeState memory sstate = stakeStakeI[_msgSender()][userStakeIndex];
        
        uint256 pStaked = sstate.endTS - sstate.claimTS;
        uint256 rewardAmt = (sstate.amount * pStaked * annualInterestRate) / (365 days * 100);

        return rewardAmt;
    }
    
    function calculatependingRewards (uint256 userStakeIndex) public view returns (uint256) {
        require(stakeStakeI[_msgSender()][userStakeIndex].amount > 0, "Stake not found");

        StakeState memory sstate = stakeStakeI[_msgSender()][userStakeIndex];
        
        uint256 pStaked = 0;
        if(block.timestamp < sstate.endTS) {
            pStaked = sstate.endTS - block.timestamp;
        } else {
            pStaked = 0;
        }

        uint256 rewardAmt = (sstate.amount * pStaked * annualInterestRate) / (365 days * 100);

        return rewardAmt;
    }

    function getAllStakes() public view returns (StakeState[] memory) {
        uint256 len = stakeCounter[_msgSender()];

        StakeState[] memory stakesWithRewards = new StakeState[](len);

        for (uint256 i = 0; i < len; i++) {
            stakesWithRewards[i] = stakeStakeI[_msgSender()][i];
        }

        return stakesWithRewards;
    }

    function getStakeInfo(uint256 userStakeIndex) external view returns (uint256, uint256, uint256, uint256, bool) {
        require(stakeStakeI[msg.sender][userStakeIndex].amount > 0, "Stake not found");

        StakeState memory sstate = stakeStakeI[_msgSender()][userStakeIndex];


        return (sstate.amount, sstate.startTS, sstate.claimTS, sstate.endTS, sstate.isWithdrawn);
    }

    function transferToken(address to,uint256 amount) external onlyOwner{
        require(baseToken.transfer(to, amount), "Token transfer failed!");  
    }

    function min(uint256 a, uint256 b) internal pure returns (uint256) {
        return a < b ? a : b;
    }  

    function pause() external onlyOwner {
        _pause();
    }

    function unpause() external onlyOwner {
        _unpause();
    }
}"
